/**
 * @param {number[]} A
 * @param {number[]} B
 * @return {number}
 */
var minDominoRotations = function (A, B) {
  if (A.length === 1) return 0;

  const minSwaps = Math.min(
    countSwaps(A[0], A, B),
    countSwaps(B[0], B, A),
    countSwaps(A[0], B, A),
    countSwaps(B[0], A, B),
  );

  return minSwaps === Infinity ? -1 : minSwaps;
};

function countSwaps(target, arr1, arr2) {
  let swaps = 0;
  for (let i = 0; i < arr1.length; i++) {
    if (arr1[i] !== target) {
      if (arr2[i] !== target) return Infinity;
      swaps++;
    }
  }
  return swaps;
}

